import './Hero.css'

function Hero(props) {
    return (
        <>
        <div className={props.cName}>
                <img alt='HeroImg' src={props.img} />
            </div>
            <div className='hero-text'>
                <h1>{props.title}</h1>
                <p>{props.text}</p>
                <a href={props.btnurl} className='show'>{props.button}</a>
            </div>
        </>
    )
}

export default Hero;
